import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home">
      <h1>Welcome to the Authentication Labyrinth</h1>
      <Link to="/challenge1">Start the Maze</Link>
    </div>
  );
};

export default Home;
